import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function Fetch() {
  const [data, setData] = useState([]);
  const [selectedAwb, setSelectedAwb] = useState(""); // Define selectedAwb and its initial state

  useEffect(() => {
    const fetchData = () => {
      fetch("http://172.22.81.182:8080/rfid/getall")
        .then((response) => response.json())
        .then((actualData) => {
          console.log(actualData);
          setData(actualData);
        })
        .catch((err) => {
          console.error("Error fetching data:", err);
        });
    };

    fetchData();
  }, []);

  const handleTrackClick = (awb) => {
    setSelectedAwb(awb); // Now setSelectedAwb is defined and can be used
  };

  // Rest of your code...
}

export default Fetch;
